import React from 'react';
import logo from './logo.svg';
import { Button } from 'semantic-ui-react'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          I am a Text label for Liam's App!
        </p>
        <Button color='blue'> I am a Text Button</Button>

      </header>
    </div>
  );
}

export default App;
